import React from 'react';

const Education = () => {
    return (
        <section id="education">
            <h2>Education</h2>
            <ul>
                <li>
                    <strong>Bachelor’s degree in Computer Science</strong> - University of District of Columbia, Washington, DC (Aug 2016 – June 2020)
                </li>
            </ul>
        </section>
    );
};

export default Education;
